    "2014-09-29T16:09:46.723594",nt"name": "usgs-small-scale-dataset-100-meter-resolution-color-shaded-relief-of-puerto-rico-and-the-u-s-v",nt"isopen":
    false,nt"url": null,nt"notes": "The Color Shaded Relief of Puerto Rico
    and the U.S. Virgin Islands map layer is a 100-meter resolution color-sliced elevation
    image of Puerto Rico and the U.S. Virgin Islands, with relief shading added to accentuate
    terrain features, in an Albers Equal-Area Conic projection. The image was produced
    by combining the 100-meter resolution color-sliced elevation and the grayscale shaded
    relief data sets that are distributed by the National Atlas of the United States.
    The color shaded relief data were derived from the National Atlas 100-meter resolution
    elevation data. The elevation data were derived from National Elevation Dataset
    (NED) data and show the terrain of the conterminous United States at a resolution
    of 100 meters. The NED is a raster product assembled by the U.S. Geological Survey,
    designed to provide national elevation data in a seamless form with a consistent
    datum, elevation unit, and projection. Data corrections made in the NED assembly
    process minimize artifacts, permit edge matching, and fill sliver areas of missing
    data. More information on NED can be found at http://ned.usgs.gov.",nt"license_title":
